// Range.js

import React from "react";
import "./Range.css";

const Range = () => {

    const [count, setCount] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      if (count < 15) {
        setCount((prevCount) => prevCount + 3);
      } else {
        clearInterval(interval);
      }
    }, 5000);

    return () => clearInterval(interval);
  }, [count]);
  return (
    <div className="range-container">
      <div className="range-item">{count}+ Happy Customers</div>
      <div className="range-item">30 + Successful Projects</div>
      <div className="range-item">120 % Conversion Rate</div>
      <div className="range-item">20 + Workshops Conducted</div>
    </div>
  );
};

export default Range;
